import React from "react";
import { Link } from "react-router-dom";

import { Header, Footer } from "../components/index";

const Barn = () => {
  return (
    <div>
      <Header />

      <div className="row">
        <div className="col-4"></div>
        <div className="col-8">
          <div className="tabs"></div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default Barn;
